function getDataForDays(){
    const data= getData();
    const dataNew = JSON.parse(JSON.stringify(data));
    Object.entries(data).forEach(([key, value]) => {
        data[key].forEach((dataValue, keyValue) => {
            if (keyValue > 0) {
                dataNew[key][keyValue] = value[keyValue] - value[keyValue - 1];
            } else {
                dataNew[key][keyValue] = dataValue;
            }
        })
    });

    return dataNew;
}